import styled from "styled-components";

const Input = styled.input`
  width: 100%;
  padding: 20px;
  margin-bottom: 10px;
  border: 0px solid;
  border-radius: 30px;
  background-color: white;
  font-size: 15px;
  font-family: 'AvenirEB';
  color: black;
`;

export default Input;
